"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Schizophrenia (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/schizophrenia-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H5394119\">",
"      <span class=\"h1\">",
"       What is schizophrenia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Schizophrenia is a brain disorder that keeps you from thinking clearly. It can cause you to see or hear things that aren&rsquo;t there, or to believe things that aren&rsquo;t true.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5394126\">",
"      <span class=\"h1\">",
"       What are the symptoms of schizophrenia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Schizophrenia can cause:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Positive symptoms",
"        </strong>",
"        &mdash; In this case, &ldquo;positive&rdquo; does not mean &ldquo;good.&rdquo; Positive symptoms are",
"        <strong>",
"         abnormal behaviors that start",
"        </strong>",
"        because of schizophrenia. Examples of positive symptoms include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Hallucinations &mdash; Hallucinations are when you hear, see, feel, smell, or taste things that aren&rsquo;t there. For example, people with schizophrenia often hear voices in their head telling them to do things when there isn&rsquo;t really anyone talking.",
"       </li>",
"       <li>",
"        Delusions &mdash; Delusions are when you believe things that are not true. For example, people with schizophrenia sometimes believe they are a famous person who is dead.",
"       </li>",
"       <li>",
"        Disorganized thinking or speech &mdash; People with schizophrenia have trouble thinking in an organized way. They can talk and talk about a lot of things before getting to the point. Sometimes they make up words or say things that do not make any sense. &nbsp;",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Negative symptoms",
"        </strong>",
"        &mdash; In this case, &ldquo;negative&rdquo; does not mean &ldquo;bad.&rdquo; Negative symptoms are",
"        <strong>",
"         normal behaviors that stop",
"        </strong>",
"        because of schizophrenia. Examples of negative symptoms include:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Not showing much emotion and not changing your facial expression",
"       </li>",
"       <li>",
"        Not moving or talking much",
"       </li>",
"       <li>",
"        Not taking showers or keeping clean",
"       </li>",
"       <li>",
"        Not having much interest in spending time with people or having fun",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Cognitive symptoms",
"        </strong>",
"        &mdash; Cognitive symptoms are symptoms that affect your ability to think clearly. People with schizophrenia have trouble:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Learning and remembering",
"       </li>",
"       <li>",
"        Understanding speech or other forms of communication",
"       </li>",
"       <li>",
"        Making sense of new information",
"       </li>",
"       <li>",
"        Solving problems",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        <strong>",
"         Emotional symptoms",
"        </strong>",
"        &mdash; People with schizophrenia often also have symptoms of anxiety or depression.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5394133\">",
"      <span class=\"h1\">",
"       Is there a test for schizophrenia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. There is no test. But your doctor or nurse should be able to tell if you have it by learning about your symptoms and doing an exam. Your doctor might need to do tests to make sure your symptoms are not caused by a different medical problem. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5394140\">",
"      <span class=\"h1\">",
"       How is schizophrenia treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Schizophrenia is treated with medicines that help control symptoms and with different types of counseling and support.",
"     </p>",
"     <p>",
"      The medicines for schizophrenia often reduce symptoms, but they take some getting used to. Sometimes people need to try a few different medicines before finding the ones that work best and cause the fewest problems. &nbsp;",
"     </p>",
"     <p>",
"      The medicines used to treat schizophrenia can cause uncomfortable side effects. If your medicines cause side effects, talk to your doctor about them. He or she might be able to lower your dose, switch you to a different medicine, or help manage the side effects in other ways. &nbsp;",
"     </p>",
"     <p>",
"      To keep schizophrenia under control, you usually must take medicines for the rest of your life. It&rsquo;s important to take them exactly as directed. Otherwise, your symptoms could get worse.",
"     </p>",
"     <p>",
"      It can also be useful for you and your family to take part in a type of therapy called &ldquo;family psychoeducation.&rdquo; This program can teach you and your loved ones some important concepts and skills, such as:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        That schizophrenia is a biological illness and not anyone&rsquo;s fault",
"       </li>",
"       <li>",
"        Ways to keep your condition from getting worse",
"       </li>",
"       <li>",
"        Ways to deal with your symptoms so that they are less stressful",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5394147\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you want to get pregnant, talk to your doctor before you start trying to get pregnant. Most women with schizophrenia need to keep taking medicines before and during pregnancy. But some women need to switch to medicines that are less likely to cause problems for the baby.",
"     </p>",
"     <p>",
"      You might be tempted to go off medicines to protect your baby. But be aware that doing that could actually do more harm than good. Women who stop their medicines before or during pregnancy often get severe schizophrenia symptoms and end up needing more medicines than they would have if they had stayed on medicines in the first place.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H5394228\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
