var title_f43_37_44634="Type I MPGN EM";
var content_f43_37_44634=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F64411%7ENEPH%2F73319%7ENEPH%2F77236%7ENEPH%2F76739&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F64411%7ENEPH%2F73319%7ENEPH%2F77236%7ENEPH%2F76739&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electron microscopy in type I membranoproliferative glomerulonephritis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph in type I membranoproliferative glomerulonephritis shows marked thickening of the glomerular capillary wall by immune deposits (arrowhead) and by interposition of mesangial cell processes (arrow). There are two layers of the glomerular basement membrane (GBM) surrounding the mesangial interposition that account for the double-contour appearance on light microscopy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electron microscopy in dense deposit disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 396px; height: 252px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph in dense deposit disease (DDD) showing dense, ribbon-like appearance of subendothelial and intramembranous material (arrow) and narrowing of the capillary lumen due to proliferation of cells (double arrow).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electron micrograph type 3 membranoproliferative glomerulonephritis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 378px; height: 270px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph in type 3 membranoproliferative glomerulonephritis (MPGN) shows marked thickening (more than three times normal) of the glomerular capillary wall and complex disruption of the glomerular basement membrane with large lucent areas (arrows) and variable decrease in thickness of the lamina densa (LD). A red cell is present in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of postinfectious glomerulonephritis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 393px; height: 249px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph shows pathognomonic subepithelial deposits (D) with a semilunar, hump-shaped appearance in postinfectious glomerulonephritis. The humps sit on top of the glomerular basement membrane (GBM). A neutrophil is attached to the denuded GBM, contributing to the glomerular inflammation. Neutrophil attraction requires the initial presence of subepithelial immune deposits so that complement chemoattractants have access to the systemic circulation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
"  <div class=\"figure\" style=\"width: 450px\">",
"   <div class=\"ttl\">",
"    Electron micrograph of a normal glomerulus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 377px; height: 266px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Electron micrograph of a normal glomerular capillary loop showing the fenestrated endothelial cell (Endo), the glomerular basement membrane (GBM), and the epithelial cells with its interdigitating foot processes (arrow). The GBM is thin, and no electron dense deposits are present. Two normal platelets are seen in the capillary lumen.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Helmut Rennke, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
